public Configuration bindArgs(Configuration config, List<String> args) throws
    Exception {
  if (LOG.isDebugEnabled()) {
    LOG.debug("Service {} passed in {} arguments:", getName(), args.size());
    for (String arg : args) {
      LOG.debug(arg);
    }
  }
  return config;
}
